import React, { Component } from "react";
import { Route, BrowserRouter } from "react-router-dom";
import Nav from "./components/global/Nav";
import Home from "./components/pages/JxSingapore2019";
import Partners from "./components/pages/Partners";
import Registration from "./components/pages/Registration";
import Track from "./components/pages/Track";
import Schedule from "./components/pages/Schedule";
import Venue from "./components/pages/Venue";
import Submission from "./components/pages/Submission";
import Rules from "./components/pages/Rules";
import Prize from "./components/pages/Prize";
import Hiring from "./components/pages/Hiring";
import Team from "./components/pages/Team";


import Rakuten from "./components/tracks/Rakuten";
import Shopee from "./components/tracks/Shopee";
import Kaspersky from "./components/tracks/Kaspersky";



class App extends Component {
    render() {
        return ( <
            div >
            <
            BrowserRouter >
            <
            div >
            <
            Nav / >
            <
            div className = "content" >
            <
            Route exact path = "/"
            component = { Home }
            /> <
            Route exact path = "/partners"
            component = { Partners }
            /> <
            Route exact path = "/register"
            component = { Registration }
            /> <
            Route exact path = "/tracks"
            component = { Track }
            /> <
            Route exact path = "/schedule"
            component = { Schedule }
            /> <
            Route exact path = "/venue"
            component = { Venue }
            /> <
            Route exact path = "/submission"
            component = { Submission }
            /> <
            Route exact path = "/rules"
            component = { Rules }
            /> <
            Route exact path = "/prize"
            component = { Prize }
            /> <
            Route exact path = "/hiring"
            component = { Hiring }
            /> <
            Route exact path = "/team"
            component = { Team }
            />

            <
            Route exact path = "/rakuten"
            component = { Rakuten }
            /> <
            Route exact path = "/shopee"
            component = { Shopee }
            /> <
            Route exact path = "/kaspersky"
            component = { Kaspersky }
            /> <
            /div> <
            /div> <
            /BrowserRouter> <
            /div>

        );
    }
}

export default App;
